  input: '"TEXT","F3XA","C00014498","All expenditures made by the committee during
    this period are generic. During the period covered by this report, no committee
    employee spent 25 percent or more of his or her time on activities related to
    a Federal election.  The committee hereby incorporates by reference Form F99 Miscellaneous
    Report, an April 22,2002 electronic filing that outlines the policies followed
    by the party in its effort to obtain the full name, address, occupation and employer
    for each contributor.  The Committee hereby incorporates by reference Form F99
    Miscellaneous Report, a May 31, 2003 electronic filing that clarifies the partys
    policy relating to payments received from candidates for goods and services provided
    by the party to said candidates.  The party did not allocate to Federal Election
    Activity (FEA Activity) any of the group health insurance and/or any other employee-specific
    fringe benefits paid and reported as administrative expenditures because no party
    employee spent more than 25% of his or her time on FEA activity and therefore
    no FEA payroll was reported on line 30(b). Accordingly, no refund of non-Federal
    fund reimbursements of administrative expenses is required. The party owns its
    own building financed by a line of credit secured by the building.  Administrative
    expenses, those payments made for the purpose of operating the committee such
    as utilities, repairs, janitorial costs, telephone service, office supplies administrative
    wages and fringes, etc., are all paid with Federal Funds.  Such expenditures are
    reported on Schedule H4 and allocated between Federal and non-Federal based upon
    the fixed percentage selected on Schedule H1. Transfers of non-Federal funds into
    the Federal Account for administrative expenditures does not exceed the percentage
    selected on form H1.  The party reports as an in-kind contribution any goods or
    services (except for a volunteers time) provided to the committeee by any entity
    or individual at an amount not less than the fair market value of such goods or
    services."'
